import React from 'react';
import {Media} from 'reactstrap'

const Food = ({title,image , id}) => 
{
    return (
        <div key = {id} className = "col-12 mt-5">
            <Media tag = "li">
                <Media left middle>
                    <Media object src = {image} alt = ""/>
                </Media>
                <Media body className= "ml-5">
                    <Media heading>{title}</Media>
                </Media>
            </Media>

        </div>
    );
};
export default Food;
